import { useState } from 'react';
import { createNode } from './factory';

const LLMRender = ({ id, data }) => {
  // Default name and description
  const [llmName, setLlmName] = useState(data?.llmName || id.replace('customLLM-', 'llm_'));
  const [description, setDescription] = useState(data?.description || 'This is an LLM node.');

  return (
    <>
      <label>
        Name:{' '}
        <input
          type="text"
          value={llmName}
          onChange={(e) => setLlmName(e.target.value)}
          style={{ width: '100%' }}
        />
      </label>
      <label>
        Description:{' '}
        <input
          type="text"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          style={{ width: '100%' }}
        />
      </label>
    </>
  );
};

export const LLMNode = createNode({
  title: 'LLM',
  inputs: [
    { id: 'system' },
    { id: 'prompt' },
  ],
  outputs: [{ id: 'response' }],
  Render: LLMRender,
});
